import axios from "axios"
var Cookies = require('js-cookie')
export const ProfileOne = (user) => {
    return new Promise((resolve, reject) => {
        // var data = {
        //     full_name: "John Doe",
        //     first_name: "string",
        //     last_name: "string",
        //     date_of_birth: "2021-05-09T01:52:07.372Z",
        //     profile_name: "jogn doe",
        //     mobile_number: "8787878787"
        // }
        // axios.defaults.withCredentials = true;
        // axios("https://designmocha-dev.el.r.appspot.com/public/profile", {
        // method: 'GET',
        // withCredentials: true
        // }).then(res => {
        //     console.log(res);
        // }).catch(err => {
        //     console.log(err.response);
        // })
            
        var config = {
            method: 'get',
            url: 'https://designmocha-dev.el.r.appspot.com/designer/portfolio',
            headers: {
                'Cookie': 'session=' + Cookies.get("session")
            }
        };
        axios(config)
            .then(function (response) {
                console.log(JSON.stringify(response.data));
            })
            .catch(function (error) {
                console.log(error);
            });

    })
}
